import React from 'react';
import { FatherName } from './App';


const ComC = () => {
    return <>
    <FatherName.Consumer>
    {(fname) => {
        return <h1> My name is kirti {fname} patil</h1>
    } }
    </FatherName.Consumer>
    </>
};

export default ComC;
